    <style>html,body,svg{
        width:95%;height:95%;background-color: whitesmoke;
        }
        @keyframes wiggle {
          20%  { transform: translateX(6px); -webkit-transform: translate(6px); -moz-transform: translate(6px);-o-transform: translate(6px); -ms-transform: translate(6px);  }
          40%  { transform: translateX(-6px); }
          60%  { transform: translateX(3px); }
          80%  { transform: translateX(-2px); }
          100% { transform: translateX(0);    }
        }
    
        .GPiece:hover  {
           animation: wiggle 1s ease;
            animation-iteration-count: 5;
            opacity: 0.7;
            cursor: pointer;
  
        }
        
        @keyframes opac {
            20% { opacity: 0.8;transform: skewX(0.4deg);}
            40%{ opacity: 0.5;transform: skewX(-0.3deg); }
            60% { opacity 0.3; transform: skewX(0.3deg);}
            80% { opacity: 0.7;transform: skewX(-0.3deg); }
            100% { opacity: 1;transform: skewX(0deg); }
        }
        
        
        .cDot{
            display: "inline-block";
            position: absolute;
        }
